import React from "react";
import PlaneService from "../services/PlaneService";
import { BrowserRouter as Router, Link, Route, Switch,} from 'react-router-dom';
import IP_PlaneComponent from "./IP_PlaneComponent";
import IP_SpainComponent from "./IP_SpainComponent";
import IP_PortugalComponent from "./IP_PortugalComponent";
import IP_OverComponent from "./IP_OverComponent";
import IP_EntryComponent from "./IP_EntryComponent";

class PlaneComponent extends React.Component {

    constructor(props){
      super(props)
        this.state = {
          planes:[]
        }
      this.loadData = this.loadData.bind(this);
    }

    componentDidMount(){
      this.loadData();
      setInterval(this.loadData, 10000);
    }

    async loadData() {
        try {
            PlaneService.getPlanes().then((response) => {
                this.setState({
                planes: response.data
            })
        });
        } catch (e) {
            console.log(e);
        }
    }

    render(){
      return(
        <div>
          <h3 className="text-center"> All planes </h3>

          <table className = "table table-striped">
            <thead>
              <tr>
                <td>Icao24</td>
                <td>Callsign</td>
                <td>Origin Country</td>
                <td>Time position</td>
                <td>Longitude</td>
                <td>Latitude</td>
                <td>Altitude</td>
                <td>Is On Ground</td>
                <td>Velocity</td>
                <td>Track</td>
              </tr>
            </thead>
              <tbody>
                {
                  this.state.planes.map(
                    plane =>
                    <tr key = {plane.id}>
                      <td>{plane.icao24}</td>
                      <td>{plane.callsign}</td>
                      <td>{plane.origin_country}</td>
                      <td>{plane.time_position}</td>
                      <td>{plane.longitude}</td>
                      <td>{plane.latitude}</td>
                      <td>{plane.baro_altitude}</td>
                      <td>{plane.on_ground.toString()}</td>
                      <td>{plane.velocity}</td>
                    </tr>
                  )
                }
              </tbody>
          </table>
        </div>
      )
    }
}

export default PlaneComponent
